import telephoneIcon from "../../assets/images/telephone.png";
import emailIcon from "../../assets/images/email.png";

const ContactSection = () => {
  return (
    <article>
      <section>
        <h4>Representante</h4>
        <p>María Liaño</p>
        <p>
          <a href="mailto:maria@eboracast.com">
            <img
              src={emailIcon}
              alt="Correo electrónico de la representante de Ariadna Santana"
            />
          </a>
          <a href="mailto:maria@eboracast.com">maria@eboracast.com</a>
        </p>
        <p>
          <a href="tel:+34609811224">
            <img
              src={telephoneIcon}
              alt="Teléfono de la representante de Ariadna Santana"
            />
          </a>
          <a href="tel:+34609811224">+34609811224</a>
        </p>
      </section>
    </article>
  );
};
export default ContactSection;
